import React from 'react';
import Navbar from '../components/Navbar';

function Home() {
  return (
    <div>
      <Navbar />
      <div className="content">
        <h1>Welcome to Stocks App</h1>
        <p>Explore the latest stock news and information.</p>
      </div>
    </div>
  );
}

export default Home;
